import React from 'react';
import Container from './Container.js'
import SmallContainer from './SmallContainer.js'
import Header from './Header'
import H1 from './H1'
import Button from './Button'
import P from './P'
import Input from './Input'
import Br from './Br'

import { CreateCardData } from '../data/CreateCardData.js'



class Create extends React.Component {
	constructor(props) {
		super(props)
		this.state = {
			id: 0,
		}
	}

	render() {
		return(
			<Container>
				<Header width='300'>
					<H1 big>Create</H1>
					<Br></Br>
					<P big>Don't be a stat sheet. Be a hero.</P>
				</Header>

				<SmallContainer width='200'>
					<P big>{CreateCardData[this.state.id].question}</P>
					<Input placeholder='Character Name'></Input>
					<Button onClick={ () => { this.setState({id: this.state.id + 1}) } }>fuck.</Button>
				</SmallContainer>
			</Container>
		);
	}

}

export default Create;
